import React, { useState } from "react";

const Feedback = ({ employee, onSubmit, onClose }) => {
  const [feedback, setFeedback] = useState("");

  const handleSubmit = (e) => {
    e.preventDefault();
    const feedbackData = {
      feedback,
      employeeId: employee.id,
    };
    onSubmit(feedbackData);
  };

  return (
    <div className="p-6 bg-whiter w-60">
      <h2 className="text-xl mb-4">Feedback for {employee.name}</h2>
      <form onSubmit={handleSubmit}>
        <table>
          <thead>
            <tr className="bg-dark text-whiter">
              <th className="border border-dark p-2">Attribute</th>
              <th className="border border-dark p-2">Agree</th>
              <th className="border border-dark p-2">Disagree</th>
            </tr>
          </thead>
        </table>
      </form>
    </div>
  );
};

export default Feedback;
